import React, { Component } from 'react'

import axios from 'axios'
export class Employee6 extends Component {
  constructor(props) {
    super(props)
    this.state = {
       list:[],
       popupbool:false,
       firstName:"",
       lastName:"",
       age:"",
       link:"",
       id:""
    }
  }
  componentDidMount(){
    axios.get('http://localhost:3040/intern-api')
    .then(res=>{this.setState({list:res.data})})
    .catch()
  }
  render() {
    const{firstName,lastName,age,link,id}=this.state
    return (
      <div>
       <br></br><br></br>
        <form className='abc'>
          {this.state.list.map(x=>(<>
          <div className='fromof'>
          <h1>FirstName</h1>
          <h2>{x.firstName}</h2>
          <h1>LastName</h1>
          <h2>{x.lastName}</h2>
          <h1>Age</h1>
          <h2>{x.age}</h2>
          <h1>Job Link</h1>
          <a href={x.link}>link</a>
          </div></>))}
        </form>
      </div>
    )
  }
}
export default Employee6
